        <p>
        Эндометрий:   толщина    мм.., эхоструктура - однородная</p>
        <p>
        Полость матки до введения физиологического раствора -  не визуализируется.</p>
        <p>
        Шейка матки: 21  х20 мм</p>
        <p>
        форма - треугольная, эхоструктура - однородная</p>
        <p>
        Полость шейки матки до введения физ.раствора - не визуализируется</p>
        <p>
        Яичники:  расположены параметрально, эхоструткура - мелкоячеистая</p>
        <p>
        Фаллопиевые трубы - до введения физ раствора - не визуализируются</p>
