        $this->insert('{{%tb_templates}}',['id'=>'462','name'=>'Цитология по Бетесда','text'=>'<p style=\"text-align: center;\">
        <span style=\"font-size:16px;\"><strong align=\"center\">Цитологическое исследование по системе Бетесда (2001)</strong></span></p>
        <div>
        <div style=\"color: rgb(0, 0, 0);\">
        <p>
        <span style=\"font-size:16px;\"><strong>A. Удовлитварительный для оценки</strong></span></p>
        <p>
        <span style=\"font-size:16px;\"><strong>B.<span style=\"font-weight: normal; font-stretch: normal; line-height: normal; font-family: "Times New Roman";\">   </span>Неудовлетварительный для оценки:мазок обработан и исследован,но неудовлетворительный для оценки из-за:</strong></span></p>
        </div>
        <div style=\"color: rgb(0, 0, 0);\">
        <span style=\"font-size:16px;\">1-много крови;</span></div>
        <div style=\"color: rgb(0, 0, 0);\">
        <span style=\"font-size:16px;\">2-много элементов воспаления;</span></div>
        <div style=\"color: rgb(0, 0, 0);\">
        <span style=\"font-size:16px;\">3-мазок скудный;</span></div>
        <div style=\"color: rgb(0, 0, 0);\">
        <span style=\"font-size:16px;\">4-мазок толстый;</span></div>
        <div style=\"color: rgb(0, 0, 0);\">
        <span style=\"font-size:16px;\">5-отсутствует эндоцервикальный компонент;</span></div>
        <div style=\"color: rgb(0, 0, 0);\">
        <span style=\"font-size:16px;\">6-мазок загрязнен посторонними компонентами(мазь,тальк и т.д.)</span></div>
        <div style=\"color: rgb(0, 0, 0);\">
        <span style=\"font-size:16px;\"><strong>C.<span style=\"font-weight: normal; font-stretch: normal; line-height: normal; font-family: "Times New Roman";\">   </span>Цитологическая картина в приделах нормы</strong></span></div>
        <div style=\"color: rgb(0, 0, 0);\">
        <span style=\"font-size:16px;\"><strong>D. Наличие патологической микрофлоры</strong>:</span></div>
        <div style=\"color: rgb(0, 0, 0);\">
        <span style=\"font-size:16px;\">1-Trichomonas vaginalis;</span></div>
        <div style=\"color: rgb(0, 0, 0);\">
        <span style=\"font-size:16px;\">2-Candida albicans;</span></div>
        <div style=\"color: rgb(0, 0, 0);\">
        <span style=\"font-size:16px;\">3-Бактериальный вагиноз (ключевые клетки);</span></div>
        <div style=\"color: rgb(0, 0, 0);\">
        <span style=\"font-size:16px;\">4-Actinomyces spp;</span></div>
        <div style=\"color: rgb(0, 0, 0);\">
        <span style=\"font-size:16px;\">5-Вирус простого герпеса.</span></div>
        <div style=\"color: rgb(0, 0, 0);\">
        <span style=\"font-size:16px;\"><strong>E.Реактивные изменения клеток характерные для:</strong></span></div>
        <div style=\"color: rgb(0, 0, 0);\">
        <span style=\"font-size:16px;\">1-воспаления;</span></div>
        <div style=\"color: rgb(0, 0, 0);\">
        <span style=\"font-size:16px;\">2-выраженного воспаления;</span></div>
        <div style=\"color: rgb(0, 0, 0);\">
        <span style=\"font-size:16px;\">3-атрофии;</span></div>
        <div style=\"color: rgb(0, 0, 0);\">
        <span style=\"font-size:16px;\">4-атрофии с воспалением</span></div>
        <div style=\"color: rgb(0, 0, 0);\">
        <span style=\"font-size:16px;\">5-гиперкератоза и/или паракератоза;</span></div>
        <div style=\"color: rgb(0, 0, 0);\">
        <span style=\"font-size:16px;\">6-ВМС-эффекта;</span></div>
        <div style=\"color: rgb(0, 0, 0);\">
        <span style=\"font-size:16px;\">7-изменения клеток по сле лучевого/химиотерапевтического лечения</span></div>
        <div style=\"color: rgb(0, 0, 0);\">
        <span style=\"font-size:16px;\">8-гиперплазия эндоцервикса</span></div>
        <div style=\"color: rgb(0, 0, 0);\">
        <span style=\"font-size:16px;\"><strong>F.<span style=\"font-weight: normal; font-stretch: normal; line-height: normal; font-family: "Times New Roman";\">    </span>Патология плоского эпителия</strong></span></div>
        <div style=\"color: rgb(0, 0, 0);\">
        <span style=\"font-size:16px;\">1.<span style=\"font-stretch: normal; line-height: normal; font-family: "Times New Roman";\">    </span>Атипичный плоский эпителий</span></div>
        <div style=\"color: rgb(0, 0, 0); margin-left: 40px;\">
        <span style=\"font-size:16px;\">а) Неопределенного значения(ASCUS)        в) не исключающий высокую степень повреждения (ASC-H)</span></div>
        <div style=\"color: rgb(0, 0, 0);\">
        <span style=\"font-size:16px;\">2.<span style=\"font-stretch: normal; line-height: normal; font-family: "Times New Roman";\">    </span>Плоскоклеточные интраэпителиальные повреждения низкой степени (LSIL), включая HPV /легкую степень дисплазии /CIN I</span></div>
        <div style=\"color: rgb(0, 0, 0);\">
        <span style=\"font-size:16px;\">3.<span style=\"font-stretch: normal; line-height: normal; font-family: "Times New Roman";\">    </span>Плоскоклеточные интраэпителиальные повреждения высокой степени (HSIL), включая умеренную и тяжелую степени дисплазии, CIN(cancer in situ) /CIN II и CIN III</span></div>
        <div style=\"color: rgb(0, 0, 0);\">
        <span style=\"font-size:16px;\">4.<span style=\"font-stretch: normal; line-height: normal; font-family: "Times New Roman";\">    </span>Плоскоклеточный рак.</span></div>
        <div style=\"color: rgb(0, 0, 0);\">
        <span style=\"font-size:16px;\"><strong>G. </strong><b>Патология железистого эпителия</b></span></div>
        <div style=\"color: rgb(0, 0, 0);\">
        <span style=\"font-size:16px;\">1.<span style=\"font-stretch: normal; line-height: normal; font-family: "Times New Roman";\">    </span>Цитологически доброкачественные клетки эндометрия у женщин старше 40 лет</span></div>
        <div style=\"color: rgb(0, 0, 0);\">
        <span style=\"font-size:16px;\">2.<span style=\"font-stretch: normal; line-height: normal; font-family: "Times New Roman";\">    </span>Атипический железистый эпителий неопределенного значения(AGC)</span></div>
        <div style=\"color: rgb(0, 0, 0);\">
        <span style=\"font-size:16px;\">           а) эндоцервикальные клетки              б) эндометриальные клетки          в) невозможно определить</span></div>
        <div style=\"color: rgb(0, 0, 0);\">
        <span style=\"font-size:16px;\">3.<span style=\"font-stretch: normal; line-height: normal; font-family: "Times New Roman";\">    </span>Аденокарцинома in situ(AIS)      </span></div>
        <div style=\"color: rgb(0, 0, 0);\">
        <span style=\"font-size:16px;\">4.<span style=\"font-stretch: normal; line-height: normal; font-family: "Times New Roman";\">    </span>Аденокарцинома.</span></div>
        <div style=\"color: rgb(0, 0, 0);\">
        <span style=\"font-size:16px;\"><b> </b></span></div>
        <div style=\"color: rgb(0, 0, 0);\">
        <span style=\"font-size:16px;\"><b>ЗАКЛЮЧЕНИЕ И КОММЕНТАРИИ</b>: </span></div>
